import { useParams } from "react-router-dom"
import {Link} from 'react-router-dom'

import { useOutletContext } from "react-router-dom"

export const User = () => {


    const {users : users2} = useOutletContext()
    const {id} = useParams()
    return(
        <div>
            User compoment  {id}

        {users.map(user => <li>{user.name}</li>)}

        </div>
    )
}
